import styled from 'styled-components';

export const Container = styled.View`
  flex: 1;
`;

export const Header = styled.View`
  flex: 2;
  background: #1C1C30;
  border-bottom-right-radius: 25;
  border-bottom-left-radius: 25;
  justify-content: center;
`;

export const Title = styled.Text`
  margin-top: 40;
  color: white;
  font-weight: bold;
  font-size: 30;
  text-align: center;
`;

export const Footer = styled.View`
  flex: 2;
  background: #DCDCDC;
`;

export const ButtonCustomerAndPurchase = styled.View`
  flex: 1;
  flex-direction: row;
  justify-content: center;
`;

export const ButtonUserAndSignOut = styled.View`
  flex: 1;
  flex-direction: row;
  justify-content: center;
`;

export const ButtonCustomers = styled.TouchableOpacity`
  width: 100;
  height: 100;
  background-color: #403558;;
  justify-content: center;
  align-items: center;
  margin-top: 20;
  border-radius: 100;
  flex-direction: column;
`;

export const ButtonPurchases = styled.TouchableOpacity`
  width: 100;
  height: 100;
  background-color: #A981FF;
  justify-content: center;
  align-items: center;
  margin-top: 20;
  margin-left: 8;
  border-radius: 100;
  flex-direction: column;

`;

export const ButtonUsers = styled.TouchableOpacity`
  width: 100;
  height: 100;
  background-color: #3465d9;
  justify-content: center;
  align-items: center;
  border-radius: 100;
  flex-direction: column;

`;

export const ButtonSignOut = styled.TouchableOpacity`
  width: 100;
  height: 100;
  background-color: #3465d9;
  justify-content: center;
  align-items: center;
  margin-left: 8;
  border-radius: 100;
  flex-direction: column;

`;

export const TitleButtonCustomers = styled.Text`
  color: white;
	font-size: 14;
	font-weight: bold;
`;

export const TitleButtonPurchases = styled.Text`
	color: white;
	font-size: 14;
	font-weight: bold;
`;

export const TitleButtonUsers = styled.Text`
  color: white;
	font-size: 14;
	font-weight: bold;
`;

export const TitleButtonSignOut = styled.Text`
  color: white;
	font-size: 14;
	font-weight: bold;
`;

export const StatusBar = styled.StatusBar`
  color: white;
`;
